INSERT INTO cad.record (id, diagnosis, username) VALUES (1, '肝体积不小，表面呈波浪状改变，肝各叶比例略失调，肝裂无增宽，肝右叶见明显不规则团块状低密度灶，左右肝内见多发低密度结节灶，边界不清，增强动脉期，肝右叶巨块不均匀强化，可见血管影，门脉期及延迟期可见强化退出；另肝内多发结节灶，动脉期部分环形强化，部分结节状强化，门脉期及延时期可见强化退出。门静脉右干及分支、肝中、右静脉可见充盈缺损，局部延伸至肝段下腔静脉内。胆囊未见增大，壁增厚，腔内未见异常密度灶；胆总管未见明显扩张；脾脏增大，大于5个肋单元；肝脾周围及腹腔见多发水样密度影。胰头钩突部见一小类圆形囊性灶，边缘见点状钙化，增强扫描未见强化。胰管未见明显扩张，强化后胰腺实质均匀强化。后腹膜见多发小淋巴结影。右肾囊肿。食道下段可见曲张静脉影。', 'patient');
